import React from 'react';
import '../Styles/style_section.scss';


function Section2() {
  return (
    <div>
        <div className='background-color2'  class="pt-16 pl-10">
             <img src="./sect2_img.png" alt="img" /> 
        </div>
        
        <div class="text-1xl font-medium pt-16"> What we offer</div>
        <div class="text-4xl font-bold pt-1"> For Tour Future Learning.</div>
        <p class="font-normal text-gray-600 dark:text-gray-400 pt-3">Here are the biggest enterprise technology acquisitions of 2021 so far, in reverse chronological order.</p>

        <div className='logo'>
            <button class="bg-[#ff6752] text-white font-medium py-2 px-4 border border-[#ff6752] rounded">
                Categories
            </button>
        </div>

    </div>
  )
}

export default Section2
